import Service from '../Service/Service.js'

export default class Photo extends Component {
  constructor(props) {
    super(props)

    this.state = {
       photo:null,
       myPhotos:[]
    }
    this.service = new Service();
  }


  getPhoto = url => {
    this.service.photoData(url)
    .then(photos =>
      this.setState({
        ...this.state,
        photos: (this.props.match.params.id) ? photos.data : photos[0]

      })
    )
  };

  albumPhotos =()=>{
    this.state.photo?(
    this.state.photo.forEach((e)=>{
      if(this.props.match.params.id === e.albumId){
        this.state.myPhotos.push(e);
      }
    })):(console.log('loading'))

  }

  componentWillMount() {
    if (this.props.match.params.id) {
      this.getPhoto(`${this.props.match.params.id}`);
    } else {
      console.log('err')
    }
    this.albumPhotos()
  }



  render() {
    console.log(this.state.myPhotos)
